INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (-363.0, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", "2030/12/17 14:59:59", 0.0, "ペコリーヌ", 1, 0.0, 1, 1, 105801, 26002, 0, 0, 26, "2015/12/17 15:00:00");
