INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (-363.0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", "2030/12/17 14:59:59", 0.0, "キャル", 1, 0.0, 1, 1, 106001, 43003, 0, 0, 43, "2015/12/17 15:00:00");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (-416.5, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", "2030/12/17 14:59:59", 0.0, "アメス", 1, 0.0, 1, 1, 123001, 43004, 0, 0, 44, "2015/12/17 15:00:00");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (-416.5, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", "2030/12/17 14:59:59", 0.0, "アメス", 2, 0.0, 1, 1, 123001, 43005, 0, 0, 44, "2015/12/17 15:00:00");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (-416.5, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", "2030/12/17 14:59:59", 0.0, "アメス", 3, 5.79, 2, 1, 123001, 43006, 0, 0, 45, "2015/12/17 15:00:00");
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (-371.5, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", "2030/12/17 14:59:59", 0.0, "アメス", 1, 0.0, 1, 1, 123001, 46001, 0, 0, 46, "2015/12/17 15:00:00");
